        /// <summary>
        /// 将词语替换为拼音和拼音首字母
        /// </summary>
        /// <param name="text">文本</param>
        /// <param name="type">替换类型</param>
        /// <returns></returns>
        internal string ReplaceTermsAndIdiom(string text, PinYinType type)
        {
            if (string.IsNullOrWhiteSpace(text))
                return string.Empty;

            ChineseTermList.ForEach(x =>
            {
                if (text.Contains(x.Text))
                {
                    switch (type)
                    {
                        case PinYinType.拼音:
                            text = text.Replace(x.Text, string.Concat(" ", x.PinYin));
                            break;
                        case PinYinType.拼音首字母:
                            text = text.Replace(x.Text, x.PinYinFirstLetter);
                            break;
                        default:
                            break;
                    }
                }
            });
            return text.Trim();
        }

        /// <summary>
        /// 将字替换为拼音和拼音首字母
        /// </summary>
        /// <param name="text">文本</param>
        /// <param name="type">替换类型</param>
        /// <returns></returns>
        internal string ReplaceWord(string text, PinYinType type)
        {
            if (string.IsNullOrWhiteSpace(text))
                return string.Empty;

            ChineseWordList.ForEach(x =>
            {
                if (text.Contains(x.Text))
                {
                    switch (type)
                    {
                        case PinYinType.拼音:
                            text = text.Replace(x.Text, string.Concat(" ", x.PinYin));
                            break;
                        case PinYinType.拼音首字母:
                            text = text.Replace(x.Text, x.PinYinFirstLetter);
                            break;
                        default:
                            break;
                    }
                }
            });
            return text.Trim();
        }


        internal string ReplaceSpecialWordSpace(string text)
        {
            if (string.IsNullOrWhiteSpace(text))
                return string.Empty;

            text = text.Replace("“ ", "“");
            text = text.Replace(" ”", "”");
            
            text = text.Replace("《 ", "《");
            text = text.Replace(" 》", "》");

            return text;
        }
    }
